export const sliderStyles = {
  container: {
    width: '100%',
    padding: '20px',
    background: '#f4f4f4',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0,0,0,0.2)',
    marginBottom: '20px',
  },
  track: {
    height: '5px',
    background: '#ddd',
    borderRadius: '5px',
  },
  range: {
    height: '5px',
    background: '#17A2B8',
    borderRadius: '5px',
  },
  thumb: {
    height: '17px',
    width: '17px',
    background: '#17A2B8',
    borderRadius: '50%',
    boxShadow: '0 0 6px rgba(0,0,0,0.2)',
  },
  rangeValues: {
    display: 'flex',
    justifyContent: 'space-between',
    fontSize: '14px',
    marginTop: '10px',
  },
};
